import React from "react";
import { Navbar, Nav, Container, Row } from "react-bootstrap";

function Header() {
  return (
    <header>
      <br />
      <Navbar bg="primary" variant="dark" collapseOnSelect>
        <Container>
          <Navbar.Brand href="/">Rhyno</Navbar.Brand>
          <Nav className="mr-auto">
            <Nav.Link href="/cart">
              <i px-2 className="fas fa-shopping-cart"></i>Cart
            </Nav.Link>
            <Nav.Link href="/login">
              <i className="fas fa-user"></i>Login
            </Nav.Link>
          </Nav>
        </Container>
      </Navbar>

      <br />
    </header>
  );
}

export default Header;
